import {TOP_FIVE} from "../actions/Actions"

const initialState = {
    victory : []
};

export default function reducer (state = initialState, action) {
    switch (action.type) {
        case ADD_SCORE : 

            return  {...state , victory : [...state.victory , action.value]}
        default:
            return state;
    }
}
